import React from "react";
import Loading from "../components/Loading";

export default function ImageGen() {
  return (
    <div className="max-w-4xl mx-auto p-10 glass-bg glass-highlight rounded-3xl border border-white/20 shadow-xl space-y-6">
      <h2 className="text-5xl font-extrabold text-purple-300 tracking-wide">
        Image Generation
      </h2>
      <p className="text-gray-300 text-lg leading-relaxed max-w-3xl mx-auto">
        Create stunning AI-generated images inspired by crypto themes with
        futuristic aesthetics.
      </p>
      <Loading />
    </div>
  );
}
